import NewTask from "./NewTask";

const TaskBlock = (props)=>{

  const [task , setTask]= useState([])
  const newTaskValueHandler = (obj)=>{
    setTask([
      ...task,obj
    ]);
    console.log(task)
  };

  return <div>
    <h2>未完成</h2>
    <NewTask onTaskValue={newTaskValueHandler} />

  </div>
};

export default TaskBlock;
